		enlargeIn = 1,
		dictSize = 3,
		numBits = 2,
		bytes = null,
		bytes_concat = null,
		result = new Uint8Array(
			getNextValue(0) * 0x40000000 +
			(getNextValue(1) << 15) +
			getNextValue(2)),
		result_index = 0,
		bits = 0,
		maxPower = 2,
		power = 0,
		data_val = getNextValue(3),
		data_position = 15,
		data_index = 4;
	
	
	
	while (power < maxPower) {
		
		bits += (data_val >> --data_position & 1) << power++;
		if (data_position === 0) {
			data_position = 15;
			data_val = getNextValue(data_index++);
		}
	}
	
	if (bits === 1) {
		return null;
	}
	
	
	bits = power = 0;
	while (power < 8) {
		
		bits += (data_val >> --data_position & 1) << power++;
		if (data_position === 0) {
			data_position = 15;
			data_val = getNextValue(data_index++);
		}
	}
	bytes = [bits];
